import React from "react";

interface FiltersProps {
  filters: {
    transaction: string;
    type: string;
    location: string;
    priceMin: number;
    priceMax: number;
    sizeMin: number;
    sizeMax: number;
    amenities: string[];
    sortBy: string;
  };
  setFilters: React.Dispatch<React.SetStateAction<any>>;
}

const FiltersSidebar: React.FC<FiltersProps> = ({ filters, setFilters }) => {
  const update = (field: string, value: any) => {
    setFilters((prev: any) => ({
      ...prev,
      [field]: value,
    }));
  };

  const toggleAmenity = (amenity: string) => {
    setFilters((prev: any) => ({
      ...prev,
      amenities: prev.amenities.includes(amenity)
        ? prev.amenities.filter((a: string) => a !== amenity)
        : [...prev.amenities, amenity],
    }));
  };

  return (
    <aside className="filters-sidebar">
      <div className="filters-header">
        <h2>Filter Properties</h2>
        <button
          className="btn-reset"
          onClick={() =>
            setFilters({
              transaction: "rent",
              type: "",
              location: "",
              priceMin: 0,
              priceMax: Infinity,
              sizeMin: 0,
              sizeMax: Infinity,
              amenities: [],
              sortBy: "newest",
            })
          }
        >
          Reset All
        </button>
      </div>

      <div className="filter-group">
        <h3 className="filter-title">Rent or Sale</h3>
        <div className="filter-options">
          <label className="radio-option">
            <input
              type="radio"
              name="transaction-type"
              value="rent"
              checked={filters.transaction === "rent"}
              onChange={() => update("transaction", "rent")}
            />
            <span className="radio-custom"></span>
            Rent
          </label>
          <label className="radio-option">
            <input
              type="radio"
              name="transaction-type"
              value="sale"
              checked={filters.transaction === "sale"}
              onChange={() => update("transaction", "sale")}
            />
            <span className="radio-custom"></span>
            Sale
          </label>
        </div>
      </div>

      <div className="filter-group">
        <h3 className="filter-title">Property Type</h3>
        <select
          className="filter-select"
          value={filters.type}
          onChange={(e) => update("type", e.target.value)}
        >
          <option value="">All Types</option>
          <option value="apartment">Apartment</option>
          <option value="house">House</option>
          <option value="studio">Studio</option>
          <option value="villa">Villa</option>
        </select>
      </div>

      <div className="filter-group">
        <h3 className="filter-title">Location</h3>
        <input
          type="text"
          className="filter-input"
          value={filters.location}
          onChange={(e) => update("location", e.target.value)}
          placeholder="City or region"
        />
      </div>

      <div className="filter-group">
        <h3 className="filter-title">Price Range</h3>
        <div className="range-inputs">
          <input
            type="number"
            className="range-input"
            value={filters.priceMin === 0 ? "" : filters.priceMin}
            onChange={(e) => update("priceMin", Number(e.target.value))}
            placeholder="Min"
          />
          <span className="range-separator">-</span>
          <input
            type="number"
            className="range-input"
            value={filters.priceMax === Infinity ? "" : filters.priceMax}
            onChange={(e) =>
              update(
                "priceMax",
                e.target.value ? Number(e.target.value) : Infinity
              )
            }
            placeholder="Max"
          />
        </div>
      </div>

      <div className="filter-group">
        <h3 className="filter-title">Size (mÂ²)</h3>
        <div className="range-inputs">
          <input
            type="number"
            className="range-input"
            value={filters.sizeMin === 0 ? "" : filters.sizeMin}
            onChange={(e) => update("sizeMin", Number(e.target.value))}
            placeholder="Min"
          />
          <span className="range-separator">-</span>
          <input
            type="number"
            className="range-input"
            value={filters.sizeMax === Infinity ? "" : filters.sizeMax}
            onChange={(e) =>
              update(
                "sizeMax",
                e.target.value ? Number(e.target.value) : Infinity
              )
            }
            placeholder="Max"
          />
        </div>
      </div>

      <div className="filter-group">
        <h3 className="filter-title">Amenities</h3>
        <div className="checkbox-options">
          {["Balcony", "Garden", "Garage", "Pool", "Elevator"].map(
            (amenity) => (
              <label className="checkbox-option" key={amenity}>
                <input
                  type="checkbox"
                  checked={filters.amenities.includes(amenity)}
                  onChange={() => toggleAmenity(amenity)}
                />
                <span className="checkbox-custom"></span>
                {amenity}
              </label>
            )
          )}
        </div>
      </div>

      <div className="filter-group">
        <h3 className="filter-title">Sort By</h3>
        <select
          className="filter-select"
          value={filters.sortBy}
          onChange={(e) => update("sortBy", e.target.value)}
        >
          <option value="newest">Newest First</option>
          <option value="price-asc">Price: Low to High</option>
          <option value="price-desc">Price: High to Low</option>
          <option value="popular">Most Popular</option>
        </select>
      </div>
    </aside>
  );
};

export default FiltersSidebar;
